import React from 'react';
import PropTypes from 'prop-types';
import Table from 'react-bootstrap/Table';

const PostTable = props => {
    return (
        <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>Item</th>
            <th>Category</th>
            <th>Username</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          { Array(10).fill(1).map((el,i) => 
              <tr>
            <td>$i</td>
            <td>Test</td>
            <td>others</td>
            <td>@sjlee2016</td>
            <td>$100</td>
          </tr>)
        }
    }
        </tbody>
      </Table>
    );
};

PostTable.propTypes = {

};

export default PostTable;
